import { useState } from 'react';

export const filterByNumber = (value) => {
  const [filterNumber, setFilterNumber] = useState(0);
  console.log('number:', value);
  return [filterNumber, setFilterNumber];
};

export const filterCompare = (value) => console.log('compare:', value);

export const filterSelect = (value) => console.log('select:', value);

export const filterBtn = (filterByNumber) => console.log('select:', filterByNumber);
